import "./App.css";
import React, { useState, useEffect } from "react";

function App() {
  const url = "https://parallelum.com.br/fipe/api/v1/motos/marcas";
  const [data, setData] = useState([]);

  const fetchInfo = () => {
    return fetch(url)
      .then((response) => res.json())
      .then((d) => setData(d))
  }


  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <div className="App">
      <h1>Consulte a tabela FIPE</h1>
      <center>
        {data.map((dataObj, index) => {
          return (
            <div> 
              <p style={{ fontSize: 20, color: 'black' }}>{dataObj.name}</p>
            </div>
          );
        })}
      </center>
    </div>
  );
}

export default App;
